import React, {useState } from 'react';
//   url: https://maps.googleapis.com/maps/api/place/textsearch/json?query=[yourquerystring]&key=[YOURAPIKEY]

var map;
var service;
var loc

function initialize() {
    loc = new window.google.maps.LatLng(-33.8665433,151.1956316);

    map = new window.google.maps.Map(<div id="map" style="width: auto; height: 550px; position: relative; overflow: hidden;"></div>, {
        center: loc,
        zoom: 15
    });
}

function GetPlace(props) {

//   const gmapikey = "AIzaSyCnTuvtwFKq21_w9gpZgcPKOFsX6FVQi0I";

    const [places, setPlaces] = useState("");



    initialize();

    function getNewPlace(){
        var request = {
        location: loc,
        radius: '500',
        query: 'restaurant'
        };

        service = new window.google.maps.places.PlacesService(map);
        service.textSearch(request, callback);
    }


    function callback(results, status) {
        if (status === window.google.maps.places.PlacesServiceStatus.OK) {
            console.log(results)
            setPlaces(results);
        }
    }

  return (
    <div>
      <header>
              <button onClick={getNewPlace}>
                Get new Place
              </button>

      </header>
    </div>
  );
}

export default GetPlace;
